import React from 'react';
import FooterContactInfo from './FooterContactInfo';
import FooterNavigation from './FooterNavigation';
import FooterCopyright from './FooterCopyright';

const FooterLayout = () => {
  return (
    <div className="d-flex flex-column" style={{ width: '100%', minHeight: '100vh', maxWidth: "1800px", margin: "20px auto", backgroundColor: '#051c34', padding: "50px 15px",
      borderRadius: "12px" }}>
      <div className="d-flex flex-row justify-content-between align-items-start" style={{ flexGrow: 1, padding: '40px 60px' }}>
        <FooterContactInfo />
        <FooterNavigation />
      </div>
      <FooterCopyright />
    </div>
  );
};

export default FooterLayout;
